@carlossainz55 after #ItalianGP 💬

“My first Italian GP with Ferrari was very special and I will always remember this weekend even it wasn’t the best in terms of results. We obviously wanted to stand on the podium in front of the tifosi but it wasn’t possible. We were not quite there in the fight today and I’ve struggled with the car more than I wanted since yesterday morning. The rear sliding, combined with the lack of top speed, eventually made things very tricky during the race. Taking everything into consideration, P6 is a decent result but that’s not what we are here for. We will have to keep improving to make sure next year we can fight for the top spot. Congratulations to McLaren on the one-two finish. Today they deserve that result and I can’t wait to race against them in Russia.”

#essereFerrari
